import React from "react";
import styled from "styled-components";

const FooterWrap = styled.footer`
  width: 100vw;
  background-color: #eee;
`;

export default function Footer(): JSX.Element {
	return (
		<FooterWrap>
			<p>푸터영역입니다.</p>
		</FooterWrap>
	);
}
